pragma solidity ^0.8.10;
import "./TokenTiket.sol";

contract VentaTikets {
    //assign Token contract to variable
    TokenTiket private token;
    address[16] public tikets;
    
    mapping(address => bool) public listaYaPidieronToken;
    uint256 votosOpcion1 = 0;
    uint256 votosOpcion2 = 0;


    function buyTiket(uint tiketIndex) public returns (bool) {
        // Comprobación
        require(tiketIndex >= 0 && tiketIndex <= 15);

        bool sucess = true;
        
        if ( tikets[tiketIndex] == address(0) ){
            tikets[tiketIndex] = msg.sender;
            token.mintConInfo(msg.sender, tiketIndex,"ACDC","23-23-23");

        } else {
            sucess = false ;
        }

        return sucess;
    }

    constructor(TokenTiket _token) public {
        token = _token;
    }

    function getTikets() public view returns (address[16] memory) {
        return tikets;
    }
}
